import React, { useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import {
  HomeIcon,
  ClipboardDocumentListIcon,
  UserIcon,
  ArrowRightOnRectangleIcon,
  ShieldCheckIcon,
  Bars3Icon,
  XMarkIcon,
  BuildingOfficeIcon
} from '@heroicons/react/24/outline';

const Navbar = () => {
  const { currentUser, isAdmin, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
    setMobileMenuOpen(false);
  };

  const isActivePath = (path) => {
    return location.pathname === path;
  };

  const navigation = [
    { name: 'Dashboard', href: '/dashboard', icon: HomeIcon, current: isActivePath('/dashboard') },
    { name: 'Tasks', href: '/tasks', icon: ClipboardDocumentListIcon, current: isActivePath('/tasks') },
    { name: 'Profile', href: '/profile', icon: UserIcon, current: isActivePath('/profile') },
  ];

  const adminNavigation = [
    { name: 'Admin Dashboard', href: '/admin', icon: ShieldCheckIcon, current: isActivePath('/admin') },
    { name: 'Users', href: '/admin/users', icon: UserIcon, current: isActivePath('/admin/users') },
    { name: 'All Tasks', href: '/admin/tasks', icon: ClipboardDocumentListIcon, current: isActivePath('/admin/tasks') },
  ];

  const allNavigation = isAdmin ? [...navigation, ...adminNavigation] : navigation;

  return (
    <nav className="bg-construction-blue shadow-lg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex items-center">
            <Link to="/dashboard" className="flex-shrink-0 flex items-center">
              <BuildingOfficeIcon className="h-8 w-8 text-hard-hat-yellow mr-3" />
              <div>
                <h1 className="text-white font-bold text-xl">Hanover & Tyke</h1>
                <p className="text-construction-gray-lighter text-xs">Task Manager</p>
              </div>
            </Link>
          </div>

          {/* Desktop navigation */}
          <div className="hidden md:flex md:items-center md:space-x-4">
            {allNavigation.map((item) => (
              <Link
                key={item.name}
                to={item.href}
                className={`${
                  item.current
                    ? 'bg-construction-blue-light text-white'
                    : 'text-construction-gray-lighter hover:bg-construction-blue-light hover:text-white'
                } px-3 py-2 rounded-md text-sm font-medium transition-colors duration-200 flex items-center`}
              >
                <item.icon className="h-4 w-4 mr-2" />
                {item.name}
              </Link>
            ))}
          </div>

          {/* User menu */}
          <div className="hidden md:flex md:items-center md:space-x-4">
            <div className="text-construction-gray-lighter text-sm">
              <span className="font-medium">{currentUser?.name}</span>
              {isAdmin && (
                <span className="ml-2 badge bg-hard-hat-yellow text-construction-blue">
                  Admin
                </span>
              )}
            </div>
            <button
              onClick={handleLogout}
              className="text-construction-gray-lighter hover:text-white transition-colors duration-200 flex items-center"
            >
              <ArrowRightOnRectangleIcon className="h-5 w-5" />
            </button>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden flex items-center">
            <button
              onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
              className="text-construction-gray-lighter hover:text-white p-2"
            >
              {mobileMenuOpen ? (
                <XMarkIcon className="h-6 w-6" />
              ) : (
                <Bars3Icon className="h-6 w-6" />
              )}
            </button>
          </div>
        </div>

        {/* Mobile navigation */}
        {mobileMenuOpen && (
          <div className="md:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1">
              {allNavigation.map((item) => (
                <Link
                  key={item.name}
                  to={item.href}
                  onClick={() => setMobileMenuOpen(false)}
                  className={`${
                    item.current
                      ? 'bg-construction-blue-light text-white'
                      : 'text-construction-gray-lighter hover:bg-construction-blue-light hover:text-white'
                  } px-3 py-2 rounded-md text-base font-medium transition-colors duration-200 flex items-center`}
                >
                  <item.icon className="h-5 w-5 mr-3" />
                  {item.name}
                </Link>
              ))}
            </div>
            <div className="pt-4 pb-3 border-t border-construction-blue-light">
              <div className="px-2 text-construction-gray-lighter">
                <div className="text-base font-medium">{currentUser?.name}</div>
                {isAdmin && (
                  <div className="badge bg-hard-hat-yellow text-construction-blue mt-1">
                    Admin
                  </div>
                )}
              </div>
              <div className="mt-3 px-2">
                <button
                  onClick={handleLogout}
                  className="w-full text-left text-construction-gray-lighter hover:text-white transition-colors duration-200 flex items-center py-2"
                >
                  <ArrowRightOnRectangleIcon className="h-5 w-5 mr-3" />
                  Logout
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
